import { Faq } from "./Faq";
import PriceButton from "./PriceButton";
import Pricetop from "./Pricetop";
import React from "react";
import Sponsors from "./Sponsors";

function Pricing() {
  return (
    <section>
      <Pricetop />
      <PriceButton />
      <Sponsors />
      <Faq />
    </section>
  );
}

export default Pricing;
